import React from 'react'
import './ArticleView.css'
import { Link } from 'react-router-dom';

export default class ArticlePreview extends React.Component {


    render(props) {
        Object.keys(props.articles).forEach(function (key, index) {
            return(
            <section id="article">
                <div id="articleImage">{props.articles.image}</div>
                <div id="articleText">
                    <h3 id="articleText">{props.articles.headline}</h3>
                    <p id="articleText">{props.articles.summary}</p>
                    <Link to="/dashboard/article"><button>View Full Article</button></Link>
                </div>
            </section>
                );
    });
}
}
